tables.table_schema:
CREATE TABLE quantum_state_vectors (
    id SERIAL PRIMARY KEY,
    vector VARCHAR(100) NOT NULL
);

CREATE TABLE machine_learning_experiments (
    id SERIAL PRIMARY KEY,
    experiment_name VARCHAR(100) NOT NULL,
    quantum_algorithm VARCHAR(100) NOT NULL
);

CREATE TABLE quantum_states (
    state_id INT PRIMARY KEY,
    state_vector VARCHAR(255)
);

CREATE TABLE experiments (
    experiment_id INT PRIMARY KEY,
    description TEXT
);

CREATE TABLE measurements (
    measurement_id INT PRIMARY KEY,
    result VARCHAR(100),
    experiment_id INT,
    FOREIGN KEY (experiment_id) REFERENCES experiments(experiment_id)
);

CREATE TABLE visualizations (
    visualization_id INT PRIMARY KEY,
    image_url VARCHAR(255),
    experiment_id INT,
    FOREIGN KEY (experiment_id) REFERENCES experiments(experiment_id)
);

CREATE TABLE StateVectors (
    id INT PRIMARY KEY,
    state_vector JSONB
);

CREATE TABLE QuantumCircuits (
    id INT PRIMARY KEY,
    circuit_name TEXT,
    circuit_description TEXT
);

CREATE TABLE ExperimentResults (
    id INT PRIMARY KEY,
    experiment_id INT,
    outcome TEXT,
    probability FLOAT
);

CREATE TABLE Observables (
    id INT PRIMARY KEY,
    observable_name TEXT,
    observable_operator TEXT
);

CREATE TABLE Entanglement (
    id INT PRIMARY KEY,
    entangled_pairs JSONB
);
